      <Route path='/about' element={<About/>}/>
      <Route path='/contact' element={<Contact/>}/>
    </Routes>
    <Footer 
    details1="hello"
    details2="hello"
    details3="hello"




    />
    </Routers>
    </>

  );
}

export default App;
